import React from "react";
import MoodSquare from './partials/MoodSquare'

const Grid = () => {
  let bgColor = "gray";

  return (
    <div>
      <div className="mood-grid">
        {Array.from({ length: 7 }, () => (
          <MoodSquare bgColor={bgColor} />
        ))}
      </div>
    </div>
  );
};

export default Grid;
